import React from "react";
import Slider from "react-slick";
const WelcomeProductList = () => {
  const settings = {
    dots: false,
    infinite: true,
    speed: 1500,
    autoplay: true,
    autoplaySpeed: 500,
    slidesToShow: 4,
    slidesToScroll: 1,
    arrows: true,
    centerPadding: 30,
    responsive: [
      {
        breakpoint: 1024,
        settings: {
          slidesToShow: 3,
          slidesToScroll: 3,
          infinite: true,
          dots: true,
        },
      },
      {
        breakpoint: 600,
        settings: {
          slidesToShow: 2,
          slidesToScroll: 2,
          initialSlide: 2,
        },
      },
      {
        breakpoint: 480,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1,
        },
      },
    ],
  };
  return (
    <div>
      <h1>Cá Ngon bán Chạy</h1>
      <Slider {...settings}></Slider>
    </div>
  );
};

export default WelcomeProductList;
